bit7:0x00=NoRequest(无请求);
0x01=MediaDisplayRequest（多媒体显示请求）;
bit6:0x00=NoRequest(无请求);
0x01=VRDisplayRequest（语音显示请求）;
bit5:0x00=NoRequest(无请求);
0x01=TelDisplayRequest（电话显示请求）;
bit4:0x00=NoRequest(无请求);
0x01=NormalDisplay(全部地图信息);
bit3:0x00=NoRequest(无请求);
0x01=UnnormalDisplay（概要地图信息）；
bit0~bit2:Reserved保留，默认值为0
显示过程中一直发送有效值

