data[0] =0x1 data[1-4]=长安硬件版本号;
data[0] =0x2 data[1-4]=长安软件版本号;

data[0] = 0x0; data[1] = LAS_OverspeedSoundWarning;
  data[0] = 0x1; data[1] = LAS_OverspeedVisualWarning;
均满足以下规则：
0x0= No Warning；0x1= Warning

data[0] = 0x0; data[1] = ADS_FLC_SystemStatus;
 data[0] = 0x1; data[1] = ADS_FRC_SystemStatus;
均满足以下规则：
0x0=Reserved；   0x1=StartUp；0x2=Running；0x3=Blocked；
0x4=Calibration；0x5=ShutDown；0x6=Hot；0x7=Failure

data[0] = 0x0;data[1] = ACC_LLLaneDetection;
data[0] = 0x1;data[1] = ACC_RRLaneDetection;
上述协议均遵守以下值设置规则：  0x0=not detected；0x1=Dashed；0x2=solid；0x3=fence/road edge
data[0] = 0x2;data[1] =ACC_LLLaneDis;(0x0-0xF0=0-12；0xF1-0xFF=reserved，单位：m，app需将拿到的值*0.05)
data[0] = 0x3;data[1] = ACC_RRLaneDis;(0x0-0xF0=-12-0；0xF1-0xFF=reserved，单位：m，app需将拿到的值*0.05-12)

data[0] = 字节长度n byte;
data[1] = can信号数量m;
data[2] - data[n] 数据域
2bit代表一个信号状态；00 代表在线，01代表超时，10|11代表无效值
